import {
    FETCH_LOGIN_SUCCESS,
    FETCH_LOGIN_FAILURE
} from 'actionsType'

const initialState = [
]

export default (state = initialState, {type, payload}) => {
    switch (type){
        case FETCH_LOGIN_SUCCESS:
            return payload
        case FETCH_LOGIN_FAILURE:
            return payload
        default:
            return state
    }
}